For 60 years, Medicaid and Medicare have been lifelines, helping families across the country access health care.

Now, Trump and House Republicans are gutting these programs and forcing hospitals to close.

@HouseDemocrats are fighting back to protect Medicaid, defend Medicare, and ensure every American can get the care they need.

Today marks three years since Russia’s brutal invasion of Ukraine.

@HouseDemocrats stand firmly for peace, but there cannot be an agreement on Ukraine without Ukraine.

This was true three years ago &amp; remains true now—Russia started this war and can end this war today.

President Musk is making good on his promise to “delete” the agency in charge of promoting fairness and transparency for mortgages, credit cards, and other consumer financial products and services.

This leaves families who have been scammed by predatory financial institutions & big banks out to dry.

@HouseDemocrats won’t let this stand.

